  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes work in the Aleutian
  Islands, Semidi Islands, and Bering Sea in support of work unit 953.10. Distribution
  and abundance of birds as seas (work unit 953.13) and impact of Japanese Gillnet
  fisheries on marine birds. All work was conducted from the F/V Western Pacific while
  it was under charter to the Alaska Maritime National Wildlife Refuge. Surveys of
  seabirds were also completed and monitored on Near, Agattu, Aitak, and Semidi Islands.\",\n\t\"license_title\":
